import React from 'react';
import logo from './logo.png';
import { Container, Row, Col } from 'reactstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header" >
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          We have raised RM50,000 for the marginalized youth
        </p>


        <div className='Icons' style={{ border: '2px solid black' }}>
          <h3 className='i'>instagram</h3>

          <h3>instagram</h3>
          <h3>instagram</h3>

        </div>


        <Container >
          <Row className="Icons">
            <Col xs='6' sm='4'>instagram</Col>
            <Col xs='6' sm='4'>whatsaoo</Col>
            <Col xs='6' sm='4'>email</Col>
          </Row>
        </Container>

      </header>


    </div>
  );
}

export default App;
